import {
  mdiAccountCircle,
  mdiDesktopMac,
  mdiShieldAccount,
  mdiSquareEditOutline,
  mdiTable,
  mdiTelevisionGuide,
  mdiResponsive
} from '@mdi/js'

export default [
  'General',
  [
    {
      to: '/',
      icon: mdiDesktopMac,
      label: 'Dashboard'
    }
  ],
  // 'Examples',
  [
    {
      to: '/tables',
      label: "Pizza's",
      icon: mdiTable,
      updateMark: true
    },
    {
      to: '/forms',
      label: "Customer's",
      icon: mdiSquareEditOutline
    },
    {
      to: '/ui',
      label: "Order's",
      icon: mdiTelevisionGuide
    },
    // {
    //   to: '/responsive',
    //   label: "Order's Details",
    //   icon: mdiResponsive
    // },
    {
      to: '/profile',
      label: "User's",
      icon: mdiAccountCircle
    }
  ],
  'About',
  [
    {
      href: 'https://tailwind-vue.justboil.me/',
      label: 'Developer Profile',
      icon: mdiShieldAccount
    }
  ]
]
